public boolean equals(Object o) {
if (this == o) return true;
if (o == null || getClass() != o.getClass()) return false;
Tag tag = (Tag) o;
if (canContainBlock != tag.canContainBlock) return false;
if (canContainInline != tag.canContainInline) return false;
